import ast
# Return: Six sets: A∪B
# , A∩B
# , A−B
# , B−A
# , Ac
# , and Bc
#  (where set complements are taken with respect to {1,2,…,n}
# ).
def solution(input):
    N, A, B = input.splitlines()
    A = ast.literal_eval(A)
    B = ast.literal_eval(B)
    N = set(range(1, int(N) + 1))
    # print(N, A, B)
    print(A | B)
    print(A & B)
    print(A - B)
    print(B - A)
    print(N - A)
    print(N - B)

